import { __DEV__, JsonApiRoot, RelationshipMode } from '../utils/constants'
import {
  AnyResourceConstructor,
  AnyResourceInstance,
  ApiEventListener,
  ApiURL,
  ResourceType,
} from '../utils/generics'
import { createDataObject } from '../utils/createDataObject'
import { Api } from './Api'
import { Type } from '../utils/Type'
import { ApiEvent } from './ApiEvent'
import { createJsonApiBaseData } from '../utils/createJsonApiBaseData'

const stores: Record<ApiURL, ApiStore> = createDataObject(null)

export class ApiStore {
  api: Api
  listeners: Array<ApiEventListener> = []
  resources: Record<ResourceType, AnyResourceConstructor> = createDataObject(
    null,
  )

  constructor(api: Api) {
    this.api = api
  }

  emitEvent(event: ApiEvent<any>) {
    this.listeners.forEach((listener: ApiEventListener) => listener(event))
  }

  decodeResourceData(Resource: any, data: any) {
    const item = Resource.fields.reduce((item: any, field: any) => {
      const value = this.getJsonApiDataValue(data, field)
      if (field.root === null) {
        item[field.name] = value
      } else if (field.root === JsonApiRoot.ATTRIBUTES) {
        item[field.name] = this.decodeResourceAttributeValue(value, field)
      } else if (field.root === JsonApiRoot.RELATIONSHIPS) {
        item[field.name] = this.decodeResourceRelationshipValue(value, field)
      }
      return item
    }, {})
    return new Resource(item)
  }

  getJsonApiDataValue(data: any, field: any) {
    const name = this.api.encodeKey(field.name)
    return field.root === null ? data[name] : data[field.root][name]
  }

  decodeResourceAttributeValue(value: any, field: any) {
    if ((field.required && value === null) || typeof value === field.type) {
      return value
    }
  }

  decodeResourceRelationshipValue(value: any, field: any) {
    const RelationshipResource = this.getApiResource(field.type)
    if (RelationshipResource !== undefined) {
      if (field.mode === RelationshipMode.TO_ONE) {
        return value.data === null
          ? null
          : new RelationshipResource.Identifier(value.data.type, value.data.id)
      } else if (field.mode === RelationshipMode.TO_MANY) {
        return value.data.map(
          (item: any) =>
            new RelationshipResource.Identifier(item.type, item.id),
        )
      }
    } else {
      throw `endpoint for Resource of type ${
        field.type
      } does not exist on api at ${this.api.url}`
    }
  }

  encodeResourceData(Resource: any, item: any) {
    return Resource.fields.reduce((data: any, field: any) => {
      const value = item[field.name]
      if (field.root === null) {
        data[field.name] = value
      } else {
        const name = this.api.encodeKey(field.name)
        data[field.root][name] = value
      }
      return data
    }, createJsonApiBaseData())
  }

  addApiResource(Resource: AnyResourceConstructor): this {
    this.resources[Resource.type] = Resource
    return this
  }

  hasApiResource(type: ResourceType): boolean {
    return type in this.resources
  }

  getApiResource(type: ResourceType): AnyResourceConstructor | undefined {
    return this.resources[type]
  }

  static add(api: Api): void {
    stores[api.url] = new ApiStore(api)
  }

  static get(api: Api): ApiStore {
    return stores[api.url]
  }

  static findPrivateMetaOfResource(resource: AnyResourceInstance): ApiStore {
    let result
    const { type, fields } = resource.constructor
    for (const key in stores) {
      const store = stores[key]
      const resource = store.getApiResource(type)
      // The static fields member (Array<ModelField>) of a Resource (extension) is used to identify a resource
      if (resource !== undefined && resource.fields === fields) {
        result = store
      }
    }
    __DEV__ &&
      Type.is(
        `a Resource with type ${type}`,
        (value: any): value is ApiStore => value !== undefined,
      ).validate(result, 'relationship type')
    return result as ApiStore
  }
}
